import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import Navbar from './components/navbar.component';
import ExercisesList from './components/exercises-list.component';
import EditExercise from './components/edit-exercise.component';
import CreateExercise from './components/create-exercise.component';
import CreateUser from './components/create-user.component';


function App() {
  function refreshpage(){
    window.location.reload(false);
  }
  return (
    <Router>
      <div className='container'>
        <Navbar />
        <br />
        <Switch>
          <Route onClick={refreshpage} exact path='/' component={ExercisesList} />
          <Route onClick={refreshpage} path='/edit/:id' component={EditExercise} />
          <Route onClick={refreshpage} path='/create' component={CreateExercise} />
          <Route onClick={refreshpage} path='/user' component={CreateUser} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
